import {
  Inner,
  Title,
  Wrapper,
  Input,
  Label,
  Button,
  InputWrapper,
} from "./styles/opt-form"

export default function optForm({ children, ...restProps }) {
  return <Inner>{children}</Inner>
}

optForm.Title = function optFormTitle({ children, ...restProps }) {
  return <Title {...restProps}>{children}</Title>
}

optForm.Wrapper = function optFormWrapper({ children, ...restProps }) {
  return <Wrapper {...restProps}>{children}</Wrapper>
}

optForm.InputWrapper = function InputWrapper({ children, ...restProps }) {
  return <InputWrapper {...restProps}>{children}</InputWrapper>
}

optForm.Input = function optFormInput({ ...restProps }) {
  return <Input {...restProps} />
}

optForm.Label = function optFormLabel({ children, ...restProps }) {
  return <Label {...restProps}>{children}</Label>
}

optForm.Button = function optFormButton({ children, ...restProps }) {
  return (
    <Button {...restProps}>
      {children} <img src="./public/images/chevron-right.png" />
    </Button>
  )
}
